        <article>
            <header class="text-center mb-8 pb-4 border-b-2 border-gray-200">
                <h1 class="text-xl text-white mb-4 leading-tight text-center">Olalekan Oliwo Discusses How Strong Ethics Set Lifted Horizon Apart</h1>
                <div class="text-gray-200 text-sm mb-8">
                    Interview with Lagos-based journalist Kehinde Adeleye
                </div>
            </header>

            <div class="text-lg">
                <p class="mb-6 text-justify">The Nigeria Country Director of Lifted Horizons, a new IT startup in Nigeria, has shared key insights on the four major ethics that make a significant impact in the business world.</p>

                <p class="mb-6 text-justify">In an exclusive interview with Lagos-based journalist Kehinde Adeleye, Olalekan Oliwo emphasized the importance of adhering to established ethical principles in order for businesses to flourish and meet desired expectations.</p>

                <p class="mb-6 text-justify">As a driving force behind Lifted Horizons' success, Oliwo's focus on these four standout ethics offers valuable guidance for entrepreneurs and business leaders seeking to build thriving, ethical organizations.</p>

                <div class="border-l-4 border-blue-600 pl-6 py-6 my-8">
                    <p class="mb-6 text-justify">Oliwo, now 52-year-old, was born in England. He expressed his strong connection to his Nigerian roots and shared that this played a significant role in his decision to return and establish a company in Nigeria.</p>
                </div>

                <p class="mb-6 text-justify">He emphasized four distinguishing ethics that are fundamental to his business philosophy:</p>
                <ul class="list-none my-6">
                    <li class="mb-2 pl-6 relative before:content-['•'] before:absolute before:left-0 before:text-gray-700">Loyalty</li>
                    <li class="mb-2 pl-6 relative before:content-['•'] before:absolute before:left-0 before:text-gray-700">Hard work</li>
                    <li class="mb-2 pl-6 relative before:content-['•'] before:absolute before:left-0 before:text-gray-700">Honesty</li>
                    <li class="mb-2 pl-6 relative before:content-['•'] before:absolute before:left-0 before:text-gray-700">Kindness</li>
                </ul>

                <p class="mb-6 text-justify">He stated that by incorporating these principles into the foundation of his company, Lifted Horizons, he aims to create a culture that fosters growth and success.</p>

                <p class="mb-6 text-justify">Expanding on his vision for Lifted Horizons, Oliwo discussed the company's subsidiaries, Pixel Perfect, Finverge advisory as well as plans to add a shipping and logistics firm and a trainee accountant firm.</p>

                <div class="border-l-4 border-blue-600 pl-6 py-6 my-8">
                    <p class="mb-6 text-justify">He excitedly stated that in the future, every employee will have the opportunity to travel to England and earn an annual salary of £22,000, providing a unique and enticing prospect for ambitious individuals.</p>
                </div>

                <p class="mb-6 text-justify">He likens this opportunity to winning a lottery ticket, demonstrating his commitment to creating a rewarding and life-changing experience for his employees.</p>
            </div>
        </article>
